    "full_text" : "• ωの構造の方がρよりも制約される傾向がある。\n• ωは後ろに行くほど聞こえ度が高くなるのが好まれる。\n• μに右があった場合，それより左の全ての出現が示唆される。\nわたり音 &gt; R音 &gt; 側面接近音 &gt; 鼻音 &gt; 摩擦音 &gt; 破裂音\n• ↑は，46言語中1/3で破裂音が違反した。",
