    "created_at" : "Wed Apr 29 15:52:50 +0000 2020",
    "favorited" : false,
    "full_text" : "基本的にわたしは善なる行為に努めようとしているが，生来の計画性の無さが原因で悪をしてしまう場合が多いし，意図的に悪をなす場合もある。（法に触れようとはしていない）",
    "lang" : "ja",
