    "full_text" : "（実際には *to- で説明するつもりだけど）\n*toː &gt; *tu#si &gt; *tǝu-si（cf. *suku#si &gt; *sukǝu-si）「鋭い」\n*to-koC &gt; *taka#si &gt; *taka-si「高い」\n*to-toC &gt; *tat«a»- &gt; *tata-「立つ」",
