    "full_text" : "詞末下降（ふなや氏の説では長母音に由来する）は語末 *n の代償延長及び1拍名詞の接続によるものではないかと考えている。\n*_maj-óː「眉」\nこれは「目」＋「緖」（1拍名詞）だと思われる。\n*_nanáː「七」\nこれは *_nanan（cf. トゥングース祖語 *nadan‘id’）。",
