    "full_text" : "というか，①A/B/C式が揃っていて②周辺言語に似た単語が無く③音節構造が似ているという条件があれば全て同根だと看做して構わないと思うのですよね。然うして残った語根と周辺言語との比較で前日琉語を探る。",
