    "full_text" : "日本語について話します。\nわたしたちは「もしかすると」と言いますが，使われ始たのは明治の様です。\n古代は「はたまた」の「はた」が近い意味で，最古の歌集『万葉集』にも見えます。\n平安期は「良くなかったら」の意味の「良う為（せ）ずは」というのも現れ，不吉な予感がするときに使われました。",
