    "favorited" : false,
    "full_text" : "考えてみると11歳のときに言語を作らうと思って五年くらい言語学してたら取り敢えず歴史言語学のやり方が分かったという話なので，世の学徒なぞたずっと遅々とした速度で，ずっと狭い範囲をしているのか。もっと速い速度でもっと弘い範囲に通暁した猫股にならなければならない。",
    "lang" : "ja"
