    "full_text" : "非常に頭の悪いことを言っていたことに気付いたがどこに訂正を入れるべきか分からなかったので削除したが，正義は時代によって変遷するが，対立構造が時代によって変化するわけではない。（非常に単純な思惟なのに莫迦なので知識の全体が連動していない）",
